detail:
studying; 
案376為案370友人，於美國就學，3月30日與案370、371一同返國，居家檢疫期間因返國搭乘的班機上有其他旅客確診，因此改列為居家隔離之接觸者。案376於4月2日至5日陸續出現咳嗽、鼻塞、流鼻水及噁心症狀，由衛生單位安排就醫採檢，於今日確診。
華航CI011

studying; 
華航CI011
案370、371為家人，兩人於美國就學及工作，3月30日入境後返家居家檢疫，由於兩人返國所搭乘班機(亦與案364同班機)上有其他旅客已確診，因此改列為居家隔離之接觸者。

business; 
華航CI011
案364於美國工作，3月10日發病，3月30日入境時主動向機場申報有症狀並採檢，檢驗結果為陰性，居家檢疫期間，因所搭乘班機上有其他旅客已確診，因此改列為居家隔離之接觸者，個案因持續有不適症狀，於4月3日由衛生單位安排就醫採檢，於今日確診。

business; 
on 3/20 (EVA Airline BR-282)
案284長期於菲律賓工作，3月20日返國時，與昨(28)日公布之案277搭乘同班機(長榮BR-282)；於26日居家檢疫期間，因身體不適，通知衛生單位就醫，今日確診；同住接觸者居家隔離中。指揮中心提醒，曾於當天搭乘同班機旅客，在居家檢疫期間務必留意自身健康狀況，如出現疑似症狀，請通知衛生單位安排就醫。

studying; 
北部30多歲法國籍男性(案216)，原列為案84之接觸者，居家隔離期間於3月20日出現發燒、咳嗽等症狀，經安排就醫及採檢通報，於今日確診，收治於負壓隔離病房。
it is the third case of an infected person in a college in Taiwan.

studying;  
the same flight with Turky travelling group
案213在西班牙就學，3月13日返國時與發生群聚的土耳其旅遊團搭乘同班機，因此列為接觸者並進行居家隔離，3月15日發病，於今日確診，相關接觸者皆居家隔離中。

visiting relatives; 
案197、202為1對夫妻，3月8日至18日至美國探親，19日發病，於今日確診，相關接觸者皆居家隔離中。
案202已在4月9日解除隔離、4月11日出院。

travelling;
新增1例境外移入嚴重特殊傳染性肺炎病例，為北部50多歲女性，1月13日至15日曾有中國大陸武漢旅遊史，未前往華南海鮮市場，1月16日至25日至歐洲旅遊，個案於1月22日起有咳嗽症狀，25日咳嗽症狀加劇，同日獨自一人返台，於機上全程佩戴口罩及填寫「防範新型冠狀病毒肺炎旅客入境健康聲明卡」，並於入境時主動告知機場檢疫人員，隨即後送至醫院負壓隔離病房治療，經通報檢驗於今(26)日確診；目前健康狀況穩定，衛生單位持續追蹤個案返台班機之相關接觸者健康情形。
As of 4 p.m. on January 26, 67 new cases of severe special infectious pneumonia were reported. Up to now, a total of 350 cases have been notified, including 4 confirmed cases, 147 excluded, 41 negative tests, and the rest are still to be tested.
